// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundStoreSettersV0 {
    function setManagerCurrent(address syndicateAddress, address currentManager)
        external;

    function setManagerSyndicate(
        address currentManager,
        address syndicateAddress
    ) external;

    function setManagerPending(address syndicateAddress, address pendingManager)
        external;

    function setManagerFeeAddress(address syndicateAddress, address feeAddress)
        external;

    function setManagerManagementFeeBasisPoints(
        address syndicateAddress,
        uint256 feeBasisPoints
    ) external;

    function setManagerDistributionShareBasisPoints(
        address syndicateAddress,
        uint256 performanceFeeBasisPoints
    ) external;

    function setSyndicateDistributionShareBasisPoints(
        address syndicateAddress,
        uint256 distributionShareBasisPoints
    ) external;

    function setNumMembersMax(address syndicateAddress, uint256 maxMembers)
        external;

    function setNumMembersCurrent(
        address syndicateAddress,
        uint256 currentMembers
    ) external;

    function setDepositERC20Address(
        address syndicateAddress,
        address depositAddress
    ) external;

    function setDepositMemberMin(address syndicateAddress, uint256 minDeposit)
        external;

    function setDepositMemberMax(address syndicateAddress, uint256 maxDeposit)
        external;

    function setDepositTotalMax(
        address syndicateAddress,
        uint256 maxDepositTotal
    ) external;

    function setDepositTotal(address syndicateAddress, uint256 total) external;

    function setDepositMember(
        address syndicateAddress,
        address memberAddress,
        uint256 deposit
    ) external;

    function setDistributionERC20Addresses(
        address syndicateAddress,
        address distributionERC20Address,
        bool isSet
    ) external;

    function setDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) external;

    function setDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) external;

    function setDistributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress,
        uint256 amount
    ) external;

    function setDateCreated(address syndicateAddress, uint256 date) external;

    function setDateClose(address syndicateAddress, uint256 date) external;

    function setOpen(address syndicateAddress, bool isOpen) external;

    function setDistributing(address syndicateAddress, bool isDistributing)
        external;

    function setModifiable(address syndicateAddress, bool isModifiable)
        external;

    function setAllowlistEnabled(address syndicateAddress, bool isEnabled)
        external;

    function setAllowlist(
        address syndicateAddress,
        address memberAddress,
        bool allowed
    ) external;

    function setTransferable(address syndicateAddress, bool isTransferable)
        external;

    function setMetadata(
        address syndicateAddress,
        string calldata metadataKey,
        string calldata metadataValue
    ) external;

    function setNotCloseable(address syndicateAddress, bool isNotCloseable)
        external;
}
